// @grant        none
// @require http://code.jquery.com/jquery-3.3.1.min.js
// ==/UserScript==

(function() {

        // Vous pouvez encoder vos images en base64 sur ce site https://www.base64-image.de (dutch qualitad)
        var imgMap = {
            burns    : 'data:image/jpeg;base64,',
            mario    : 'data:image/jpeg;base64,',
            pimp     : 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQLRuCKxVGDtASgxTpsxkjltrZuz9xRmVgmBd4wOtge7M3i3g403Q',
            hermione : 'data:image/jpeg;base64,',
            pastis   : 'data:image/jpeg;base64,',
            machoire : 'data:image/jpeg;base64,',
            cactus   : 'https://media1.giphy.com/media/m6vQwPNb7vegg/200.webp?cid=3640f6095c541c4635374b526fb82e0e',
            flamby   : 'data:image/jpeg;base64,',
            kick     : 'https://media1.tenor.com/images/74b79a7dc96b93b0e47adab94adcf25c/tenor.gif?itemid=8217719',
            balibo   : 'data:image/jpeg;base64,'
        };

        var map = {
           "David Audouze"            :new UserSettings(imgMap.machoire,'David O12',"Si tu ne sais pas mordre, ne montre point tes dents."),
           "Franois Brossier"        :new UserSettings(imgMap.balibo,'Jean Balibo',"Botaniste attentif du rire!"),
           "Alexandre Le Pon"         :new UserSettings(imgMap.pimp,"Alex 'The PIMP' Le Pon","Matre des ponts"),
           "Eric Peresse"             :new UserSettings(imgMap.hermione,"Eric JS","0 deaths in Overwatch !"),
           "Nicolas SINQUIN"          :new UserSettings(imgMap.pastis,"Nicolas 5-1","mise tout sur ghoddos"),
           "Anael TRICHET"            :new UserSettings(imgMap.cactus,'Yann Trichet','vous tes tous de vulgaires cactus'),
           "Jonathan Brice Lambrecht" :new UserSettings(imgMap.flamby,null,'Je fume du flan et alors ?'),
           "Claire Gaudet"            :new UserSettings(imgMap.kick,null,'Membre de child free et danseuse de claquettes')
        };

        function UserSettings(img,title,description){
              this.img = imageExists(img) ? img : null;
              this.title = title;
              this.description = description;
        }

        // Test si l'url de l'image est valide
        // XMLHttp deprci , pas le temps de trouver une alternative
        function imageExists(image_url){

                if(image_url === undefined || image_url === null)
                    return false;

                let http = new XMLHttpRequest();

                http.open('HEAD', image_url, false);
                http.send();

                return http.status != 404;

            }

        var fiches_personnes = Array.from(document.querySelectorAll('.fiche_personne'));

        for (var key in map) {
           let infos = fiches_personnes.find(function(element){ return element.children[1].children[0].innerHTML === key; });

           if(!infos)
              continue;

           let settings = map[key];

            // le portrait
           if(settings.img){
                let img = infos.getElementsByTagName('img')[0];
                img.src = settings.img;
           }

           // le nom / titre
           if(settings.title){
                let title = infos.getElementsByClassName('nom')[0];
                title.innerHTML = settings.title;
           }

           // la fonction / description
           if(settings.description){
               let desc = infos.getElementsByClassName('fonction')[0];
               desc.innerHTML = settings.description;
           }
        }
        
        // --- Cration thmes graphiques ---
        var arp_style = document.createElement("select");
        arp_style.id = "arp_style";
		document.body.insertBefore(arp_style,document.body.firstChild);



        TR_styleAdd = function(cls,name,css) {
            var option = document.createElement("option");
            option.value = cls;
            option.text = name;
            arp_style.appendChild(option);
            TR_cssAdd(css);
        }

        TR_cssAdd = function(css) {
            try {
                style= document.getElementById('trombi_css');
                style.innerHTML += css;
            } catch (e)
            {
                style = document.createElement("style");
                style.id = 'trombi_css';
                style.setAttribute('type', 'text/css');
                style.innerHTML = css;
                document.head.appendChild(style);
            }
        }

        // ajout de styles
        TR_styleAdd('-1','style par defaut','');
        TR_styleAdd('magicArp','rainbow arpege','@-moz-keyframes magicArp{from{background-position:top left}to{background-position:top right}}@-webkit-keyframes magicArp{from{background-position:top left}to{background-position:top right}}@-o-keyframes magicArp{from{background-position:top left}to{background-position:top right}}@-ms-keyframes magicArp{from{background-position:top left}to{background-position:top right}}@-khtml-keyframes magicArp{from{background-position:top left}to{background-position:top right}}@keyframes magicArp{from{background-position:top left}to{background-position:top right}} .magicArp * h2{background-image:-webkit-linear-gradient(left,red,orange,#ff0,green,#00f,indigo,violet,indigo,#00f,green,#ff0,orange,red);background-image:-moz-linear-gradient(left,red,orange,#ff0,green,#00f,indigo,violet,indigo,#00f,green,#ff0,orange,red);background-image:-o-linear-gradient(left,red,orange,#ff0,green,#00f,indigo,violet,indigo,#00f,green,#ff0,orange,red);background-image:-ms-linear-gradient(left,red,orange,#ff0,green,#00f,indigo,violet,indigo,#00f,green,#ff0,orange,red);background-image:-khtml-linear-gradient(left,red,orange,#ff0,green,#00f,indigo,violet,indigo,#00f,green,#ff0,orange,red);background-image:linear-gradient(left,red,orange,#ff0,green,#00f,indigo,violet,indigo,#00f,green,#ff0,orange,red);animation:magicArp .5s forwards linear infinite;background-size:50% auto;-webkit-background-clip:text;-moz-background-clip:text;-o-background-clip:text;-ms-background-clip:text;-khtml-background-clip:text;background-clip:text;color:transparent!important}' )

	arp_style.addEventListener("change",function() {
		let cls = this.value !== '-1' ? this.value : '';
		document.body.classList = "";
		document.body.classList.add(cls);
	        });
        })();
